CREATE TABLE "visitor_vehicles" ("id" integer NOT NULL, "visitor_log_id" integer NOT NULL, "vehicle_number" text, "vehicle_type" text, "created_on_utc" timestamp without time zone NOT NULL, "modified_on_utc" timestamp without time zone, "deleted_on_utc" timestamp without time zone, "is_deleted" boolean DEFAULT false NOT NULL, "created_by" uuid NOT NULL, "modified_by" uuid, PRIMARY KEY ("id"));